package palindrome;

public class Shortest_Palindrome_214 {

  public static void main(String[] args) {

    System.err.println(shortestPalindrome("aacecaaa"));
    System.err.println(shortestPalindrome("aabaaa"));
    System.err.println(shortestPalindrome("abcd"));

    System.err.println(shortestPalindrome(""));

  }

  public static String shortestPalindrome(String s) {
    int s_length = s.length();
    String reversrStr = reverseString(s);
    int[] prefixCount = longestPrefixWhichIsASuffixAlso((s + "*" + reversrStr));
    int[] table = getTable((s + reversrStr));


    return reverseString(s.substring(prefixCount[prefixCount.length - 1])) + s;
  }


  public static int[] longestPrefixWhichIsASuffixAlso(String s) {

    char[] chars = s.toCharArray();
    int left = 0;
    int[] prefixCount = new int[chars.length];
    for (int i = 1; i < chars.length; ) {
      int c = chars[i];
      if (c == chars[left]) {
        prefixCount[i] = ++left;
        i++;
      } else {
        if (left > 0) {
          // This piece is for input= 'aabcaaa'' -- For this special case we need this
          left = prefixCount[left - 1];
        } else {
          i++;
        }
      }
    }
    return prefixCount;

  }

  // Alternative to longestPrefixWhichIsASuffixAlso. longestPrefixWhichIsASuffixAlso() and getTable()  are doing same thing.
  public static int[] getTable(String s) {
    //get lookup table
    int[] table = new int[s.length()];

    //pointer that points to matched char in prefix part

    int index = 0;
    //skip index 0, we will not match a string with itself
    for (int i = 1; i < s.length(); i++) {
      if (s.charAt(index) == s.charAt(i)) {
        //we can extend match in prefix and postfix
        table[i] = table[i - 1] + 1;
        index++;
      } else {
        //match failed, we try to match a shorter substring

        //by assigning index to table[i-1], we will shorten the match string length, and jump to the
        //prefix part that we used to match postfix ended at i - 1
        index = table[i - 1];

        while (index > 0 && s.charAt(index) != s.charAt(i)) {
          //we will try to shorten the match string length until we revert to the beginning of match (index 1)
          index = table[index - 1];
        }

        //when we are here may either found a match char or we reach the boundary and still no luck
        //so we need check char match
        if (s.charAt(index) == s.charAt(i)) {
          //if match, then extend one char
          index++;
        }

        table[i] = index;
      }

    }

    return table;
  }

  public static String reverseString(String s) {
    return new StringBuilder(s).reverse().toString();
  }


  String s = "";
}
